def get_sol(): return Solution()
class Solution:
    # https://leetcode.com/problems/russian-doll-envelopes/discuss/82763/Java-NLogN-Solution-with-Explanation/87015
    def maxEnvelopes(self, envelopes: List[List[int]]) -> int:
        def lengthOfLIS(nums):
            res = []
            for val in nums:
                idx = bisect_left(res,val)
                if idx == len(res):
                    res.append(val)
                else:
                    res[idx] = val
            return len(res)

        envelopes.sort(key=lambda x:(x[0],-x[1]))
        heights=[e[1] for e in envelopes]
        return lengthOfLIS(heights)
class Solution2:
    # tle
    def maxEnvelopes(self, envelopes: List[List[int]]) -> int:
        @functools.lru_cache(None)
        def dfs(a,b):
            if (a,b) not in di: return 1
            maxx=0
            for x,y in di[a,b]:
                maxx=max(maxx,1+dfs(x,y))
            return maxx

        n=len(envelopes)
        envelopes.sort()
        x=[e[0] for e in envelopes]
        y=[e[1] for e in envelopes]
        di=defaultdict(list)
        for i,(a,b) in enumerate(envelopes):
            idx=bisect_right(x,a)
            for i in range(idx,n):
                if b<y[i]:
                    di[a,b].append((x[i],y[i]))

        return max(dfs(a,b) for a,b in envelopes)


